import React, { Component } from 'react'

export default class checkbox extends Component {
    constructor(props){
super(props);
this.state={};
    }
  render() {
      const {data}=this.props;
      var filterLanguage=[];
      var filterGenre=[];
      data.map((x)=>{
        if(filterLanguage.indexOf(x.language)===-1){
            filterLanguage.push(x.language)
        }
        if(filterGenre.indexOf(x.genre)===-1){
            filterGenre.push(x.genre)
        }
      })
    return (
        <div>
        {filterLanguage.map((lang)=>
        <label key={lang}><input type="checkbox" onClick={this.props.onChange} value={lang}/>{lang}</label>)}
           { filterGenre.map((lang)=>
            <label key={lang}><input type="checkbox" onClick={this.props.onChange} value={lang}/>{lang}</label>)}
            </div>
                  )

  }
}
